import React from 'react';
import ReactPlayer from 'react-player';
import './VideoQueue.css';
const VideoQueue = ( {videoNames, changeVideo, deleteVideo} ) => {
	const state = {
		playing: 0,
		width: '168 px',
		height: '94 px',
		controls: false

	}
	const videoComp = (videoNames || []).slice(-1).map((user, i) => {
		return (
		<div className = 'playerContainer'  >
			<ReactPlayer 
		      	url = {JSON.stringify(videoNames[i].youtube)}
		      	width = {state.width}
		      	height= {state.height}
		      	playing = {state.playing}
		      	controls = {state.controls}
		      	onClick={changeVideo}
		      	/>
		      	<button onClick = {()=> {deleteVideo(videoNames[i])}}>Delete</button>
		</div>)
	})	

	return(
		
		<div>
			{videoComp}
		</div>
	);
}

export default VideoQueue;
